 tenta fazer tudo que é mandado.','3º SGT JOÃO LIBERATO','2022-04-27',23),(65,'Dor no pé(calcanhar) nos dias 02/03 e 04/03. Tomou injeção de remédio para dor e ganhou dispensa até a recuperação total. Segue em dispensa domiciliar.','3º SGT JOÃO LIBERATO','2022-04-27',130),(66,'Dor no pé. Tomou injeção de dipirona no dia 04/03/22.','3º SGT JOÃO LIBERATO','2022-04-27',131),(67,'Permaneceu isolado por sintomas de covid-19 desde o dia 06/03 até se recuperar. Perdeu as instruções 3.B101, 24.B101, 7.B104 e B107, 10.B106, 14.B102, 1.B101 e 16.B101 e 102.','3º SGT JOÃO LIBERATO','2022-04-27',41),(68,'Dor no joelho, tosse, tontura e vômito no dia 07/03/22. Logo, foi dispensado de OU e TFM por um dia.','3º SGT JOÃO LIBERATO','2022-04-27',38),(69,'Dor no joelho no dia 07/03/22. Logo, foi dispensado de OU e TFM por um dia. O militar segue em dispensa domiciliar por uma lesão ocasionada no ombro.','3º SGT JOÃO LIBERATO','2022-04-27',18),(70,'Dor no joelho no dia 07/03/22. Logo, foi dispensado de OU e TFM por um dia.','3º SGT JOÃO LIBERATO','2022-04-27',125),(71,'Vômito e tontura no dia 08/03/22. Recebeu injeção de dipirona e retornou às atividades.','3º SGT JOÃO LIBERATO','2022-04-27',23),(72,'Sintomas de covid-19 no dia 08/03/22. No entanto, não foi para o isolamento.','3º SGT JOÃO LIBERATO','2022-04-27',38),(73,'Permaneceu isolado por sintomas de covid-19 desde o dia 06/03 até se recuperar. Perdeu as instruções 3.B101, 24.B101, 7.B104 e B107, 10.B106, 14.B102, 1.B101 e 16.B101 e 102.','3º SGT JOÃO LIBERATO','2022-04-27',122),(74,'1) vacinas: 2 doses, pfiser\r\n2) Possui dificuldade no tfm (corrida e barra)','TEN SUMAIO','2022-05-04',169),(75,'Teve depressão em 2020 mas já se recuperou.','TEN SUMAIO','2022-05-04',230),(78,'Mãe foi estrupada pelo padrasto, mãe também tem problema na mão que atrapalha a trabalhar, (o militar parece ainda estar abalado pela situação).','TEN SUMAIO','2022-05-04',225),(79,'Dificuldade financeira, pai e mãe estão desempregados.','TEN SUMAIO','2022-05