UI IRMÃOS\r\nSABE MANEJAR FERRAMENTAS (INCHADA E PÁ)\r\nORGULHO DE ESTAR AQUI','Asp Ferraiollo','2022-05-26',265),(219,'Conhecimento de marcenaria. Família bem unida. Não tem pai. Que fazer faculdade de agronomia. Faz o 3 médio a noite.','Asp Ferraiollo','2022-05-26',266),(220,'Faz faculdade de agronomia. Quer servir e seguir carreira militar.','Asp Ferraiollo','2022-05-26',267),(221,'Estabilidade familiar. Pais com saúde frágil. Se inspira nos pais.','Asp Ferraiollo','2022-05-26',268),(222,'Gosta de festas e ter vida social ativa. Bom relacionamento familiar. Focado em dar uma estabilidade aos entes queridos.','Asp Ferraiollo','2022-05-26',269),(223,'Curso técnico em informática. Bom relacionamento familiar. Quer fazer agronomia ou técnico de segurança do trabalho. Sentimentos nacionalistas e patrióticos. ','Asp Ferraiollo','2022-05-26',270),(224,'Bom relacionamento familiar. Queria servir o EB. Possível candidato a carreira militar.','Asp Ferraiollo','2022-05-26',271),(225,'Pais divorciados recentemente. Não tem bom relação com o pais desde então. Está gostando da vida no quartel (possível que tente cursos militares)','Asp Ferraiollo','2022-05-26',272),(226,'Pais divorciados. Participou do pelotão esperança. Tem irmãos de um padrasto. Quer seguir carreira pela ESA.','Asp Ferraiollo','2022-05-26',273),(227,'Conhecimentos como eletricista, mecânico, pizzaria, serralheria. Pai doente e incapaz de trabalhar. Auxilia a avó em tarefas de casa e com o salário familiar. Quer ser PM. Não quer ficar.','Asp Ferraiollo','2022-05-26',274),(228,'Muito dedicado. Mesmo com rotina apertada dava um jeito de estudar e ainda realizar um treinamento físico. Foi destaque na faculdade. Irmã que o apoiava a servir faleceu e ele quer honrar a irmã. Quer chegar a sargento, mas tem perfil para o oficialato. \r\nMais bem votado na semana verde. Além de ter recebido a maior parte dos votos, ainda foi colocado como o melhor (destaque) dentre os votados por diversas vezes.','Asp Ferraiollo','2022-05-26',275),(229,'Muito ansioso e por isso tem dificuldades de aprender. Toca bateria.\r\nMaior número de votos negativos na semana verde. Sendo quase unânime.','Asp Ferraiollo','2022-05-26',276),(230,'FAMÍLIA ESTRUTURADA MESMO COM A MORTE DO PAI\r\nDIFICULDADES COM SITUAÇÕES NOVAS, FICA ANSIOSO','Asp Ferraiollo','2022-05-26',277),(231,'CRIADO PELOS AVÓS, MAS TEM BOM RELACIONAMENTO COM A MÃE\r\nQUER SEGUIR CARREIRA MILITAR','Asp Ferraiollo','2022-05-26',278),(232,'Família instável, mãe com problemas de saúde. Quer fazer medicina veterinária. Embora os pais sejam separados parece ter bom relacionamento com ambos. Quer fazer ESA','Asp Ferraiollo','2022-05-26',279),(233,'JÁ TRABALHOU POR NECESSIDADE. APRESENTA PROBLEMAS EMOCIONAIS','Asp Ferraiollo','2022-05-26',280),(234,'HABILIDADE COM CONSTRUÇÃO CIVIL\r\nHABILIDADE COM MECÂNICA DE EQUIPAMENTOS\r\nBOA RELAÇÃO FAMILIAR\r\nRELACIONAMENTO ESTÁVEL\r\nQUER FAZER CURSO DE MECÂNICO INDUSTRIAL\r\nQUER ENGAJAR','Asp Ferraiollo','2022-05-26',281),(235,'FACILIDADE EM INFORMÁTICA\r\nBOM RELACIONAMENTO FAMILIAR','Asp Ferraiollo','2022-05-26',282),(236,'CRIADO PELOS AVÓS\r\nMÃE O ABANDONOU POR DEPRESSÃO\r\nFUNDAMENTAL INCOMPLETO (TRABALHO)\r\nTEM OUTROS PROBLEMAS','Asp Ferraiollo','2022-05-26',283),(237,'HABILIDADE EM EXATAS\r\nBOM RELACIONAMENTO FAMILIAR\r\nQUER FAZER ENFERMAGEM OU FÍSICA\r\nQUER ENGAJAROCASIÃO DA APRESENTAÇÃO DO SERVIÇO DE PLANTÃO DEMONSTRANDO BOA ELOQUÊNCIA E DESENVOLTURA. ','Asp Ferraiollo','2022-05-26',284),(238,'DIFICULDADE DE IDENTIDADE\r\nPROBLEMAS COM RAIVA E FRUSTRAÇÃO\r\nTRABALHA BEM EM GRUPOS PEQUENOS\r\nDIFICULDADE COM HIERARQUIA\r\nNÃO TEM UMA RELAÇÃO FAMILIAR MUITO BOA','Asp Ferraiollo','2022-05-26',285),(239,'HABILIDADE EM CONSTRUÇÃO CIVIL\r\nENGENHEIRO DE MAQUINA PESADA\r\nPAIS DIVORCIADOS\r\nPOUCO CONTATO COM O PAI\r\nPROBLEMAS EMOCIONAIS','Asp Ferraiollo','2022-05-26',286),(240,'Irmão de 29 anos com paralisia cerebral. Conhecimento em informática e quer aprender mecânica. ','Asp Ferraiollo','2