-01',23),(250,'Destacou-se negativamente na Operação Boina Preta recebendo 16 votos negativos no sociométrico realizado por seus companheiros de pelotão como um possível militar que não seria levado para a guerra.','3º SGT JOÃO LIBERATO','2022-06-01',128),(251,'Foi observado positivamente pelos pares durante a execução do campo de instrução básico, sagrando-se destaque positivo do período da IIB.','3º SGT HONÓRIO','2022-06-02',17),(252,'Foi o destaque da Operação Boina da 3ª Bia O, sendo o mais escolhido no sociométrico e em diversas oficinas.','Ten Arceno','2022-06-02',163),(253,'Ficou dispensado  de  esforços  físicos,  Formaturas  e  Treinamento  Físico  Militar,  por  05  (cinco)dias, a contar do dia 13 MAR 22.','3º SGT HONÓRIO','2022-06-02',72);
